// Horizontal scaling filter coefficients.
// Horizontal scaling filter is a 6-tap filter with 4-bit positional phase.
// Coefficients 0 and 5 are 3-bit signed value ranging from -4 to 3.
// Coefficients 1 and 4 are 5-bit signed value ranging from -16 to 15.
// Coefficients 2 and 3 are 8-bit unsigned value ranging from 0 to 128.
// Coefficient 0 is the multiplier for the earliest pixel (P0) in the group of 6-pixel and
//   coefficient 5 is the multiplier for the latest pixel (P5) in the group. The output pixel
//   positional phase is defined as centered in P2 if the positional phase is 0 or
//   proportionally in between P2 and P3 if the positional phase is larger than 0.
// Sum of all coefficients for each phase should be 128 typically and software should never
//   program the the sum of all coefficients for a phase to be more than 128.
// For each horizontal positional phase, the 6 filter coefficients requires 32 reg bits.
// Note that color value ranges from 0 to 255 for Y, R, G, B and -128 to 127 for U and V.

