// Vertical scaling filter coefficients.
// Vertical scaling filter is a 2-tap filter with 4-bit positional phase.
// Coefficients 0 and 1 are 8-bit unsigned value ranging from 0 to 128.
// Coefficient 0 is the multiplier for the earlier pixel (P0) in the group of 2-pixel and
//   coefficient 1 is the multiplier for the later pixel (P1) in the group. The output pixel
//   positional phase is defined as centered in P0 if the positional phase is 0 or
//   proportionally in between P0 and P1 if the positional phase is larger than 0.
