//   YUV422R   = 16-bpp YUV422 rotated planar
//   YCbCr422RA= 16-bpp YCbCr422 rotated planar
//               with chroma averaging
//   YUV422RA  = 16-bpp YUV422 rotated planar
//               with chroma averaging
#define DC_WIN_B_COLOR_DEPTH_0_B_COLOR_DEPTH_SHIFT                      _MK_SHIFT_CONST(0)
