#define DC_WIN_B_COLOR_DEPTH_0_B_COLOR_DEPTH_DEFAULT                    _MK_MASK_CONST(0x0)
#define DC_WIN_B_COLOR_DEPTH_0_B_COLOR_DEPTH_DEFAULT_MASK                       _MK_MASK_CONST(0x0)
#define DC_WIN_B_COLOR_DEPTH_0_B_COLOR_DEPTH_SW_DEFAULT                 _MK_MASK_CONST(0x0)
