// DDA increment is typically calculated by dividing (Pre-scaled size in pixels - 1) by
//  (Post-scaled size in pixels - 1). The result should be round-ed up and expressed as 4.12 format
//  (4-bit integer and 12-bit fraction). For non-filtered image this value can be slightly
//  larger so that it is not missing the last row/column. Reference programming values (H and V 
//  should be calculated separately depending on filter on/off and sizes):
//  - Filter on:  min(round((prescaled_size_in_pixels - 1) * 0x1000 / (post_scaled_size_in_pixels - 1)), MAX)
//  - Filter off: min(round(prescaled_size_in_pixels * 0x1000 / (post_scaled_size_in_pixels - 1) - 0.5), MAX)
//  Where the value of MAX is as follows:
//  For V_DDA_INCREMENT: 15.0 (0xF000)
//  For H_DDA_INCREMETN:  4.0 (0x4000) for 2 Bytes/pix formats. 
//                        8.0 (0x8000) for 4 Bytes/pix formats.
//  They are theoretical biggest values that guarantees not displaying beyond an image boundary.
//  If the DDA increment is less than 1.0 then image will be up-scaled and if DDA increment 
//  is more than 1.0 then image will be down-scaled.

