//  7 possible overlap area combinations. For every window in each overlap area combination,
//  color key can be disabled or enabled. Also, for every window in each overlap area
//  combination, there is a corresponding window blend control parameter and a window blend
//  weight parameter. The window blend control parameter is always effective but the window
//  blend weight is not always used. The window blend weight can also be derived from
//  pixel alpha value or from the reverse of other overlapping windows weight.
//  
//  Color keying has the highest priority for display window blending. Color key consists of
//  a range of color which is searched independently for each windows. If more than 1 windows
//  color keys are enabled then Window A color key has the highest priority, followed by
//  Window B color key, and then followed by Window C color key. Two sets of color key range
//  (Color Key 0 and Color Key 1) can be defined and they are shared for all windows. It is
//  possible to use both color key sets for the same window or for two separate windows.
//  The two sets of color key ranges should not overlap and if they do the overlap colors
//  are treated as if they are part of Color Key 0 and not part of Color Key 1.
//
//  Assuming that there is no overlap with other higher priority window with color key not
//  matched, if a window color key is enabled for any overlap condition and the window pixel
//  is not within the color key range (key not match), then the window pixel will not be
//  blended with other overlapping window pixels but it will be weighted. The weight is not
//  dependent on the overlap condition it is controlled by the same set of parameters for all
//  overlapping condition.
//
//  Assuming that there is no overlap with other higher priority window with color key not
//  matched, if a window color key is enabled for a particular overlap condition and the window
//  pixel is within the color key range (key match), then the window pixel will be weighted and
//  blended with other overlapping pixels and this is controlled separately for each overlap
//  condition.
//
//  Assuming that there is no overlap with other higher priority window with color key not
//  matched, if a window color key is disabled then the window pixel will be blended with other
//  overlapping pixels and this is controlled separately for each overlap condition.
//
// Display Color Key parameters
// For B4G4R4A4, B5G6R5A, B5G6R5 mode, color key should be compared prior to color conversion to
//  24-bpp and unused least significant bits of the pixel are filled with zeros.
// For palettized mode, color key is compared prior to color palette and the palettized
//   color is compared against the green color key values/mask.
// For YUV mode, U and V are offset by +128 before performing the color key comparison.
// In all cases, color key is compared prior to horizontal/vertical scaling filter
//   and prior to digital vibrance control.
// Both upper and lower values are inclusive.

