// Register DC_WIN_B_HP_FETCH_CONTROL_0  // Window B High Priority avoidance fetch parameters.
// This register gives extra information to the Memory Controller
// Client Interface (MCCIF) about the number of memory words that
// will be fetched per scan line and about the rate at wich those
// words are consumed. This allows the MCCIF to more accurately
// arbitrate memory accesses to prevent the use of the High Priority
// signal. Use of this signal causes all other client accesses to be
// blocked in preference to the client asserting HP. Obviously, this
// is a state which is sometime necessary for Display since it is an
// isochronous client and MUST be serviced in a timely manner.
// However, use of this signal should be avoided if possible. These
// parameters help the MCCIF avoid the over-use of HP.
//
#define DC_WIN_B_HP_FETCH_CONTROL_0                     _MK_ADDR_CONST(0x714)
#define DC_WIN_B_HP_FETCH_CONTROL_0_SECURE                      0x0
#define DC_WIN_B_HP_FETCH_CONTROL_0_WORD_COUNT                  0x1
#define DC_WIN_B_HP_FETCH_CONTROL_0_RESET_VAL                   _MK_MASK_CONST(0x0)
#define DC_WIN_B_HP_FETCH_CONTROL_0_RESET_MASK                  _MK_MASK_CONST(0x80000000)
#define DC_WIN_B_HP_FETCH_CONTROL_0_SW_DEFAULT_VAL                      _MK_MASK_CONST(0x0)
#define DC_WIN_B_HP_FETCH_CONTROL_0_SW_DEFAULT_MASK                     _MK_MASK_CONST(0x0)
#define DC_WIN_B_HP_FETCH_CONTROL_0_READ_MASK                   _MK_MASK_CONST(0xffffffff)
#define DC_WIN_B_HP_FETCH_CONTROL_0_WRITE_MASK                  _MK_MASK_CONST(0xffffffff)
// Window B clock cycles per memory fetch word.
// The value of this field is essentially a measure of the data
// consumption rate for window B. It is computed as follows:
//
// B_CYCLES_PER_WORD = B_DDA_INCREMENT.B_H_DDA_INCREMENT / (bytes per pixel)
//
// Note that the format for this value is a fixed-point fractional value
// with 8 bits of integer precision and 8 bits of fractional precision.
// In other words, it is an '8.8' number. For example, if there is no scaling
// of the input image, the DDA increment will be 4096. With 32-bit RGBA pixels
// there will be 4 bytes per pixel, so CYCLES_PER_WORD will be ...
// 
// 4096 / 4 = 1024, or 4.0 expressed in the 8.8 format.
// 
// Any scaling performed on the pixels will change the rate at which pixels
// are consumed. Scaling up will increase the value of DDA increment and will
// therefore increase the number of cycles between memory fetches. Conversely,
// scaling down will decrease the value of DDA increment and memory fetches
// will occur more frequently.
//
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_CYCLES_PER_WORD_SHIFT                     _MK_SHIFT_CONST(0)
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_CYCLES_PER_WORD_FIELD                     (_MK_MASK_CONST(0xffff) << DC_WIN_B_HP_FETCH_CONTROL_0_B_CYCLES_PER_WORD_SHIFT)
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_CYCLES_PER_WORD_RANGE                     15:0
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_CYCLES_PER_WORD_WOFFSET                   0x0
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_CYCLES_PER_WORD_DEFAULT                   _MK_MASK_CONST(0x0)
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_CYCLES_PER_WORD_DEFAULT_MASK                      _MK_MASK_CONST(0x0)
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_CYCLES_PER_WORD_SW_DEFAULT                        _MK_MASK_CONST(0x0)
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_CYCLES_PER_WORD_SW_DEFAULT_MASK                   _MK_MASK_CONST(0x0)

// Window B memory fetch words per scan line.
// This value is in memory fetch words: Multilpes of 16 bytes for AP20.
// It is computed as follows:
//
// B_WORDS_PER_LINE = (B_SIZE.B_H_SIZE * (bytes per pixel) + 15) >> 4
// bytes per pixel is determined by the pixel format.
//
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_WORDS_PER_LINE_SHIFT                      _MK_SHIFT_CONST(16)
#define DC_WIN_B_HP_FETCH_CONTROL_0_B_WORDS_PER_LINE_FIELD                      (_MK_MASK_CONST(0x7fff) << DC_WIN_B_HP_FETCH_CONTROL_0_B_WORDS_PER_LINE_SHIFT)
