//
// The registers under DC_WINBUF are triple-buffered.
// 
// 1. Overview: 
//    START_ADDR, BUF_STRIDE, LINE_STRIDE, ADDR_H_OFFSET, ADDR_V_OFFSET combined, specify the 
//    starting address of a window buffer in the memory surface. Generally START_ADDR is programmed 
//    with the starting address of the memory surface. H/V_OFFSET specify the address offsets of 
//    the pixel at the beginning of the window, with respect to the starting address of the memory 
//    surface. (There is an exception to that when memory surface is not well aligned, see 3-ii below.) 
//    Note that "beginning of the window" here means the top-left corner of a window in normal mode, 
//    top-right corner in horizontal flipping, bottom-left corner in vertical flipping, and bottom-right 
//    in horizontal+vertical flipping.
// 2. Starting address calculation:
//    These formula are same for both tiled or linear mode. However, for linear mode, the addresses
//    calculated are real physical addresses, but for tile mode, these addresses will be translated
//    to the real physical addresses by the memory controller client before used.
//    i. When a window is host triggered, starting address of a window is calculated as follows by HW.
//       - non-yuv-planar modes:
//           starting-address = START_ADDR + ADDR_V_OFFSET * LINE_STRIDE + ADDR_H_OFFSET
//       - yuv-planar modes:
//           y-starting-address = START_ADDR + ADDR_V_OFFSET * LINE_STRIDE + ADDR_H_OFFSET
//           u-starting-address = START_ADDR_U + ADDR_V_OFFSET * UV_LINE_STRIDE / denom1 + ADDR_H_OFFSET / denom2
//           v-starting-address = START_ADDR_V + ADDR_V_OFFSET * UV_LINE_STRIDE / denom1 + ADDR_H_OFFSET / denom2
//         where denom1/denom2 equal to 1 or 2 depending on the actual planar format, derived natively by HW.
//    ii. When a window is non-host triggered, starting address of a window buffer is calculated as below.
//       - non-yuv-planar mode:
//           starting-address = START_ADDR + BUF_STRIDE * buf_index + ADDR_V_OFFSET * LINE_STRIDE + ADDR_H_OFFSET
//       - yuv-planar mode:
//           y-starting-address = START_ADDR + BUF_STRIDE * buf_index + ADDR_V_OFFSET * LINE_STRIDE + ADDR_H_OFFSET
//           u-starting-address = START_ADDR_U + UV_BUF_STRIDE * buf_index + ADDR_V_OFFSET * UV_LINE_STRIDE / denom1 + ADDR_H_OFFSET / denom2
//           v-starting-address = START_ADDR_V + UV_BUF_STRIDE * buf_index + ADDR_V_OFFSET * UV_LINE_STRIDE / denom1 + ADDR_H_OFFSET / denom2
//         where denom1/denom2 equal to 1 or 2 depending on the actual planar format, derived natively by HW.
//         buf_index is the index transmitted by the triggering module pointing to the first buffer
//         of a frame. 
// 3. Programming restrictions:
//    i. For tiled address mode:
//       Image surface can only aligned to multiples of 256, thus the following restrictions.
//       - START_ADDR, START_ADDR_U, START_ADDR_V need to be multiples of 256.
//       - BUF_STRIDE, UV_BUF_STRIDE need to be multiples of 256
//       - LINE_STRIDE, UV_LINE_STRIDE  need to be multiples of 16
//       - ADDR_H_OFFSET needs to be multiple of 2 in yuv planar format (the last bit is ignored),
//           but with no restrictions on other color formats.
//       - ADDR_V_OFFSET has no restrictions
//    ii.For linear address mode:
//       Image surface can be aligned 2, 4 or 8 bytes, depending on the color formats.
//       As an addional restriction for display, START_ADDR, START_ADDR_U and START_ADDR_V need to be multiples of 16.
//       When a surface is not aligned to 16 bytes, program START_ADDR with the memory surface address with its
//       least 4 significant bits zeroed out and add these 4 address bits to the original H_OFFSET. (So the formula in 2-i,ii still hold)
//       - For all formats:
//          -- START_ADDR, START_ADDR_U and START_ADDR_V need to be multiples of 16.
//       - For 16-bpp formats, 
//          -- (START_ADDR+H_OFFSET) need to be multiple of 2. The least significant bit of H_OFFSTE is ignored.
//       - For 32-bpp formats, 
//          -- (START_ADDR+H_OFFSTE) needs to be multiple of 4. The least two significant bits of H_OFFSTE are ignored.
//       - For yuv planar formats:
//          -- BUF_STRIDE, UV_BUF_STRIDE:
//             BUF_STRIDE[2:1]=UV_BUF_STRIDE[1:0]
//             or as a stricter constraint: BUF_STRIDE be multiple of 8, UV_BUF_STRIDE be multiple of 4.
//          -- LINE_STRIDE, UV_LINE_STRIDE:
//             LINE_STRIDE and UV_LINE_STRIDE need to be at least 16.
//             LINE_STRIDE needs to be multiple of 8, UV_LINE_STRIDE needs to be multiple of 4.
//          -- ADDR_H_OFFSET:
//             Needs to be multiple of 2. If needs to point to odd pixel position, program ADDR_H_OFFSET to be the
//             previous position (or the next position if H-flipped) and program H_INITIAL_DDA bit 12 to 1.
//          -- ADDR_V_OFFSET:
//             Needs to be multiple of 2. If needs to point to odd line number, program ADDR_V_OFFSTE to be the previous
//             line number (or next line number if V-flipped) and program V_INITIAL_DDA bit 12 to 1.
//   iii.Memory allocation for non-host triggered case:
//      When a window buffer is not controlled by host (software) then a frame may be stored in 
//      multiple buffers. In this case, the buffers must be contiguous in the memory because 
//      display will use the same luma or chroma line strides for all lines in the frame.
//      Also buffer wraparound must not occur in the middle of the displayed part of the frame.
//      The controlling module will send frame start and frame end indicators (flags) to display
//      module to indicate the beginning and end of frame. Buffer start address is latched when
//      frame start flag is active but the actual buffer start address is not swithced until
//      frame end flag is active. In the case where one buffer correspond to one frame then frame
//      start and frame end flag are active everytime a buffer index is sent.

